import React from 'react';
import Container from './container';
import Text from './text';
import Link from 'next/link';

const AskUploadModal = () => {
  return (
    <Container
      style={{
        position: 'absolute',
        width: '100%',
        height: '100%',
        background: '#4e4e4e6b',
        zIndex: 99999,
        top: '0',
      }}
    >
      <Container
        wsize="400px"
        hsize="250px"
        flexDirection="column"
        style={{ borderRadius: '10px', background: '#ccc' }}
      >
        <Text fontSize="big" style={{ margin: '30px', color: '#333' }}>
          방금 저장하신 그림을
          <br />
          업로드 하러 가시겠습니까?
        </Text>
        <Container style={{ margin: '0',  }} wsize="150px" hsize="50px">
          <Link href="">
            <a>예</a>
          </Link>
          <Text>아니오</Text>
        </Container>
      </Container>
    </Container>
  );
};

export default AskUploadModal;
